"use strict";(self.webpackChunkquic_framework=self.webpackChunkquic_framework||[]).push([[130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/Handler","metadata":{"permalink":"/blog/Handler","editUrl":"https://github.com/QuicFrameworkDoc/doc/tree/main/blog/blog/Handler.md","source":"@site/blog/Handler.md","title":"Handler","description":"\u7528\u4e8e\u5904\u7406HTTP\u8bf7\u6c42\u5e76\u5199\u5165\u54cd\u5e94","date":"2024-07-26T08:54:58.000Z","tags":[],"readingTime":5.365,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"nextItem":{"title":"HttpFilter","permalink":"/blog/HttpFilter"}},"content":"\u7528\u4e8e\u5904\u7406HTTP\u8bf7\u6c42\u5e76\u5199\u5165\u54cd\u5e94\\n\\n## \u5bf9\u5e94\u51fd\u6570:\\n> \u666e\u901a\u8def\u7531\u6ce8\u518c\\n\\n**\\\\*Server.AddHttpHandler(path, HttpMethod string, handler RouteDisPatch.HttpHandle)**\\n\\n> \u53c2\u6570\u8def\u7531\u6ce8\u518c(\u53c2\u6570\u9ed8\u8ba4\u4f4d\u7f6e\u5728\u8bf7\u6c42\u4f53/\u8bf7\u6c42\u5934)\\n> \\n> \u4e5f\u6709\u66f4\u65b9\u4fbf\u7684\u65b9\u5f0f\uff0c\u8bf7\u67e5\u770b\u4e0b\u6587\u7684feature\\n\\n**\\\\*Server.AddBodyParamHandler(path, HttpMethod string, param interface\\\\{\\\\}, handler RouteDisPatch.HttpHandle)**\\n\\n\\n**\\\\*Server.AddHeaderParamHandler(path, HttpMethod string, param interface\\\\{\\\\}, handler RouteDisPatch.HttpHandle)**\\n\\n## \u53c2\u6570\u8bf4\u660e:\\n\\n### path\\n\u7ed1\u5b9a\u7684http\u8bf7\u6c42\u8def\u5f84\\n\u8bf7\u6c42\u503c\u53ef\u4ee5\u4e3a:\\n1. \u6b63\u5e38\u5b57\u7b26\u4e32:\\n\\n> \u5982`/helloWorld`,\u5339\u914d\u7684\u5c31\u662f\u8bbf\u95ee`https://{basURL}/helloWorld`\u7684\u8bf7\u6c42\\n\\n\\n2. \u901a\u914d\u7b26*\u6216**\\n\\n*\u5339\u914d\u5f53\u524d\u4e00\u7ea7\u7684\u6240\u6709\u76ee\u5f55\\n\\n**\u5339\u914d\u5f53\u524d\u76ee\u5f55\u4e0b\u7684\u6240\u6709\u8bf7\u6c42\\n\\n> \u5982`/user/role/*/userData`\u5339\u914d\u7684\u5c31\u662f\u8bbf\u95ee\u5982:\\n>\\n>`https://{basURL}/user/role/1/userData`\\n>\\n>`https://{basURL}/user/role/2/userData`\\n>\\n> \u7684\u6240\u6709\u8bf7\u6c42\\n\\n> \u5982`/user/role/**`\u5339\u914d\u7684\u5c31\u662f\u8bbf\u95ee\u5982:\\n>\\n> `https://{basURL}/user/role/abc`\\n>\\n> `https://{basURL}/user/role/dc/userData`\\n> \\n> \u7684\u6240\u6709\u8bf7\u6c42\\n\\n3. \u89c4\u5219\u8bf7\u6c42\\n\\n\u7c7b\u4f3c\u4e8e:`{name(string):step(uint)}`\\n\u4f8b\u5b50:\\n> `/user/{userName:1}`\\n> \\n> `/userName/{fullName:2}`\\n\\n\u5bf9\u5e94\u5339\u914d\u7684\u8bf7\u6c42\u8def\u5f84:\\n\\n> `/user/ben`\\n> \\n> `/userName/Alice/Center`\\n\\n> **\u6ce8\u610f:** \u63a8\u8350\u548cparam\uff0c\u53c2\u6570\u8def\u7531\u6ce8\u518c\u4e00\u8d77\u4f7f\u7528\\n\\n### HttpMethod\\n\\nHttp\u8bf7\u6c42\u65b9\u6cd5\uff0c\u548chttp\u89c4\u8303\u4e2d\u7684\u8bf7\u6c42\u65b9\u6cd5\u540c\u6b65\uff0c\u63a8\u8350\u76f4\u63a5\u4f7f\u7528\\n```go\\nhttp.Methodxxx\\n```\\n\u8fdb\u884c\u58f0\u660e\\n\\n### param\\n\\n\u53c2\u6570\u8def\u7531\u5fc5\u586b\u53c2\u6570\uff0c\u5fc5\u987b\u662f\u7ed3\u6784\u4f53\u6307\u9488(\u5982\u6b32\u4f7f\u7528\u81ea\u52a8\u6ce8\u5165\u8bf7\u6c42\u53c2\u6570\u7684\u8bdd)\\n\\n\u5bf9\u5e94\u51fd\u6570\\n\\n\u9ed8\u8ba4\u53c2\u6570\u5728\u8bf7\u6c42\u4f53\u4e2d\\n\\n**\\\\*Server.AddBodyParamHandler(path, HttpMethod string, param interface\\\\{\\\\}, handler RouteDisPatch.HttpHandle)**\\n\\n\\n\u53c2\u6570\u9ed8\u8ba4\u5728\u8bf7\u6c42\u5934\u4e2d\\n\\n**\\\\*Server.AddHeaderParamHandler(path, HttpMethod string, param interface\\\\{\\\\}, handler RouteDisPatch.HttpHandle)**\\n\\n\u8bbe\u8ba1\u521d\u8877:\\n\\n\u5728\u5f00\u53d1\u4e2d\u7ecf\u5e38\u4f1a\u6709\u4e00\u4e2a\u63a5\u53e3\u53c2\u6570\u4f1a\u6765\u81ea\u5982\u4e0b\u5730\u65b9:\\n1. \u8bf7\u6c42\u5934\u62ff\u5230token/\u5176\u4ed6\u6743\u9650\u76f8\u5173\u6570\u636e\\n2. \u8bf7\u6c42\u4f53\u4e2d\u62ff\u5230\u5b9e\u9645\u8bf7\u6c42\u7684\u6570\u636e\\n3. \u8bf7\u6c42path\u4e2d\u62ff\u5230id\u7b49\u76f8\u5173\u7684\u8def\u5f84\u4fe1\u606f(\u7ed3\u5408path\u4e2d\u7684\u89c4\u5219\u8bf7\u6c42\u4f7f\u7528)\\n\\n\u5bfc\u81f4\u53ef\u80fd\u4e00\u4e2a\u5f88\u7b80\u5355\u7684\u63a5\u53e3\uff0c\u9700\u8981\u4ece\u4e09\u4e2a\u4e0d\u540c\u7684\u5730\u65b9\u5206\u522b\u89e3\u6790\u5f97\u5230\u6570\u636e\uff0c\u6240\u4ee5\uff0c\u672c\u6846\u67b6\u5c06\u8fd9\u4e09\u4e2a\u5730\u65b9\u7684\u6570\u636e\u90fd\u8fdb\u884c\u4e00\u4e2a\u5904\u7406\uff0c\u53ea\u9700\u5f00\u53d1\u8005\u6ce8\u518c\u8def\u7531\u65f6\u8c03\u7528\u4e00\u4e2a\u4e0d\u540c\u7684\u6ce8\u518c\u51fd\u6570\u5373\u53ef\u5728HttpHandle\u4e3b\u4f53\u5904\u7406\u51fd\u6570\u62ff\u5230\u5bf9\u5e94\u7684\u6570\u636e\\n\\n\u5bf9\u4e8eparam\u7ed3\u6784\u4f53\u6ca1\u6709\u592a\u591a\u7684\u8981\u6c42\uff0c\u5982\u679c\u662f\u8c03\u7528AddBodyParamHandler\u8fdb\u884c\u6ce8\u518c\u7684\u8bdd\uff0c\u5219\u8bf7\u6c42\u4f1a\u4ece\u8bf7\u6c42\u7684Form\u8868\u5355\u83b7\u53d6\u6570\u636e\uff0c\u5982\u679c\u662fAddHeaderParamHandler\u7684\u8bdd\uff0c\u8bf7\u6c42\u4f1a\u4ece\u8bf7\u6c42\u5934\u4e2d\u62ff\u53d6\u6570\u636e\\n\\n\u4f46\u8bf7\u6ce8\u610f\uff0c\u5982\u679c\u662f\u9700\u8981\u4ece\u8bf7\u6c42\u5934/Form\u8868\u5355\u62ff\u53d6\u6570\u636e\u7684\u8bdd\uff0c\u90a3\u4e48\u7ed3\u6784\u4f53\u4e2d\u4e0d\u80fd\u518d\u5d4c\u5957\u7ed3\u6784\u4f53\uff0c\u5e76\u4e14\u7c7b\u578b\u53ea\u80fd\u662fgolang\u7684\u57fa\u7840\u6570\u636e\u7c7b\u578b\uff0c\u4e0d\u7136\u4f1a\u6ce8\u5165\u5931\u8d25(json\u6570\u636e\u4e0d\u53d7\u5355\u5c42\u7ed3\u6784\u4f53\u7684\u9650\u5236\uff0cAddBodyParamHandler\u548cAddHeaderParamHandler\u5747\u53ef\u6ce8\u5165\u6210\u529f)\\n\\n> \u989d\u5916\u8bf4\u660e\\n\\n\u5982\u679c\u662f\u65e2\u6709formData/headerData\u7684\u60c5\u51b5\uff0c\u53ef\u4ee5\u4f7f\u7528\u7ed3\u6784\u4f53\u6ce8\u91ca\u6765\u6807\u6ce8,\u76ee\u524d\u7684\u6ce8\u91ca\u7ed3\u6784\u5982\u4e0b:\\n\\n```go\\nconst (\\n\\tlocationTag  = \\"quickLoc\\"     //\u53c2\u6570\u4f4d\u7f6e\u5728\u54ea\\n\\tdefaultValue = \\"quickDefault\\" //\u53c2\u6570\u9ed8\u8ba4\u503c\\n\\tparam        = \\"quickParam\\"   //\u53c2\u6570\u5bf9\u5e94\u7684param\u540d\u5b57\uff0c\u7c7b\u4f3c\u4e8e `json:\\"name\\"`\\n)\\n\\nconst (\\n\\theader   = \\"header\\"\\t// http\u8bf7\u6c42\u5934\u4f20\u53c2\\n\\tbody     = \\"body\\"\\t//Body\u4f20\u53c2(\u76ee\u524d\u6682\u65f6\u672a\u505a\u5bf9\u5e94\u64cd\u4f5c)\\n\\treqParam = \\"param\\" //param\u4f20\u53c2,\u7c7b\u4f3c\u4e8ewww.baidu.com?name=Baidu\\n)\\n```\\n\u4e3e\u4e2a\u4f8b\u5b50:\\n\\n```go\\npackage main\\nimport(\\n\\t\\t\\"fmt\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteDisPatch\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteHand\\"\\n\\t\\"net/http\\"\\n)\\ntype TestStruct struct {\\n\\tName         string\\n\\tRequestParam string `quickLoc:\\"param\\"`\\n\\tHeader       string `quickLoc:\\"header\\"`\\n\\tAge          int    `quickLoc:\\"param\\"`\\n}\\nfunc main() {\\n\\t//\u53ef\u4fe1\u7684\u8bc1\u4e66\\n\\tnewServer := server.NewServer(\\"cert.pem\\", \\"cert.key\\", \\":4445\\")\\n\\tnewServer.AddBodyParamHandler(\\"/temp/**\\", http.MethodPost, &TestStruct{}, func(w http.ResponseWriter, r *RouteDisPatch.Request) {\\n\\t\\ttestStruct := r.Param.(*TestStruct)\\n\\t\\tfmt.Println(*testStruct)\\n\\t})\\n}\\n\\n```\\n\\n\\n### HttpHandle\\n\\n\u5904\u7406\u51fd\u6570\uff0c\u5bf9\u4e8e\u7ecf\u8fc7Filter\u8fc7\u6ee4\u7684\u8bf7\u6c42\u8fdb\u884c\u5b9e\u9645\u5904\u7406\\n\\n\u51fd\u6570\u5177\u4f53\u683c\u5f0f\u5982\u4e0b:\\n\\n```go\\n func(w http.ResponseWriter, r *RouteDisPatch.Request) {\\n\\n }\\n\\n```\\n1. http.ResponseWriter:\\n\\n\u5c31\u662fnet/http\u5305\u4e2d\u7684ResponseWriter\uff0c\u53ef\u76f4\u63a5\u4f7f\u7528\u5176\u76f8\u5e94\u53c2\u6570\\n\\n2. RouteDisPatch.Request:\\n\\n\u5185\u5c01\u88c5\u4e86\u4e24\u4e2a\u53c2\u6570:http.Request\u548cParam interface\\\\{\\\\}\\n\\nhttp.Request\u5c31\u662fnet/http\u5305\u4e2d\u539f\u751f\u7684http.Request,Param interface\\\\{\\\\}\u5c31\u662f\u5728\u8c03\u7528AddBodyParamHandler\u6216AddHeaderParamHandler\u4e2d\u7684Param\u4f7f\u7528\u65f6\uff0c\u9700\u8981\u5bf9\u5176\u5f3a\u5236\u8f6c\u6362\u4e00\u4e0b,\u5982\u679c\u4e0d\u60f3\u624b\u5199\u5f3a\u5236\u8f6c\u6362\uff0c\u63a8\u8350\u4f7f\u7528\u4e0b\u9762feature\u7684\u529f\u80fd\\n\\n\\n## feature(\u8fd8\u672a\u4e25\u683c\u6d4b\u8bd5\uff0c\u5982\u6709bug\u8bf7\u53ca\u65f6\u53cd\u9988)\\n\\n\\n\u4e3b\u8981\u662f\u7b80\u5316\u81ea\u52a8\u6ce8\u5165\u6d41\u7a0b\uff0c\u4e0d\u9700\u8981\u5f00\u53d1\u4eba\u5458\u624b\u52a8\u5f3a\u5236\u8f6c\u6362\u7c7b\u578b\\n\\n> \u53ef\u4ee5\u79fb\u6b65\u81f3\u6e90\u7801\u67e5\u770b\uff0c\u4e3b\u8981\u662f\u8c03\u7528\u4e4b\u524d\u65b0\u589e\u4e86\u4e00\u6b21\u5f3a\u5236\u8f6c\u6362:\\n> https://github.com/wangshiben/QuicFrameWork/blob/master/server/RouteHand/routAdd.go\\n>\\n> \u6ca1\u6709\u6587\u6863\u662f\u56e0\u4e3a\u53ef\u80fd\u968f\u65f6\u90fd\u5728\u53d8\\n\\n\u8c03\u7528\u793a\u4f8b:\\n\\n```go\\npackage main\\nimport(\\n\\t\\t\\"fmt\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteDisPatch\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteHand\\"\\n\\t\\"net/http\\"\\n)\\ntype TestStruct struct {\\n\\tName         string\\n\\tRequestParam string `quickLoc:\\"param\\"`\\n\\tHeader       string `quickLoc:\\"header\\"`\\n\\tAge          int    `quickLoc:\\"param\\"`\\n}\\nfunc main() {\\n\\t//\u53ef\u4fe1\u7684\u8bc1\u4e66\\n\\tnewServer := server.NewServer(\\"cert.pem\\", \\"cert.key\\", \\":4445\\")\\nRouteHand.PostAutowired(newServer, \\"/mmm/bck/**\\", func(q *RouteHand.QuickFrameWork[TestStruct]) {\\n\\t\\tparam := q.Param\\n\\t\\tfmt.Println(param)\\n\\t})\\n}\\n```"},{"id":"/HttpFilter","metadata":{"permalink":"/blog/HttpFilter","editUrl":"https://github.com/QuicFrameworkDoc/doc/tree/main/blog/blog/HttpFilter.md","source":"@site/blog/HttpFilter.md","title":"HttpFilter","description":"\u5176\u5b9e\u5bf9\u4e8eFilter\u4e5f\u597d\uff0cMiddleware\u4e5f\u7f62\uff0c\u4ed6\u4eec\u7684\u57fa\u672c\u6d41\u7a0b\u7684\u90fd\u662f\u4e00\u6837\u7684\uff0c\u90fd\u662f\u5728Handler\u5904\u7406HTTP\u8bf7\u6c42\u4e4b\u524d\u5bf9Http\u8bf7\u6c42\u8fdb\u884c\u4e00\u4e2a\u9884\u64cd\u4f5c\uff0c\u4f46\u4e24\u8005\u7684\u533a\u522b\u4e3b\u8981\u8fd8\u662f\u5728\u4f7f\u7528\u9762\u5411\u7684\u5bf9\u8c61\u4e0a","date":"2024-07-26T08:54:58.000Z","tags":[],"readingTime":3.96,"hasTruncateMarker":false,"authors":[],"frontMatter":{"id":"my-blog-post","title":"HttpFilter"},"unlisted":false,"prevItem":{"title":"Handler","permalink":"/blog/Handler"},"nextItem":{"title":"API\u6587\u6863","permalink":"/blog/README"}},"content":"\u5176\u5b9e\u5bf9\u4e8eFilter\u4e5f\u597d\uff0cMiddleware\u4e5f\u7f62\uff0c\u4ed6\u4eec\u7684\u57fa\u672c\u6d41\u7a0b\u7684\u90fd\u662f\u4e00\u6837\u7684\uff0c\u90fd\u662f\u5728Handler\u5904\u7406HTTP\u8bf7\u6c42\u4e4b\u524d\u5bf9Http\u8bf7\u6c42\u8fdb\u884c\u4e00\u4e2a\u9884\u64cd\u4f5c\uff0c\u4f46\u4e24\u8005\u7684\u533a\u522b\u4e3b\u8981\u8fd8\u662f\u5728\u4f7f\u7528\u9762\u5411\u7684\u5bf9\u8c61\u4e0a\\n\\nFilter\u6ce8\u91cd\u4e8e\u5728\u67d0\u4e2ahttp\u8bf7\u6c42\u7684Path\u4e4b\u524d\u8fdb\u884c\u8c03\u7528\uff0c\u6362\u53e5\u8bdd\u8bf4\uff0c\u5b83\u4e13\u6ce8\u5728http\u7684Path\u8fdb\u884c\u5339\u914d\u548c\u5904\u7406\\n\\nMiddleware\u6ce8\u91cd\u4e8e\u5728\u6267\u884c\u4ee3\u7801/\u51fd\u6570\u4e4b\u524d\u8fdb\u884c\u8c03\u7528\uff0c\u53ef\u590d\u7528\u7a0b\u5ea6\u5e7f\uff0c\u4f46\u5bb9\u6613\u9020\u6210\u4e00\u4e9b\u53ef\u8bfb\u6027\u7684\u95ee\u9898\\n\\n\u6240\u4ee5\u672c\u6846\u67b6\u4e3a\u4e86\u4fdd\u8bc1\u5f00\u53d1\u4eba\u5458\u7684\u8f7b\u91cf\u5316\u5f00\u53d1\uff0c\u91c7\u7528\u7684\u662fFilter\u5f0f\u7684\u8bf7\u6c42\u62e6\u622a\u7b56\u7565\\n\\n## \u6d89\u53ca\u51fd\u6570:\\n\\n**\\\\*Server.AddFilter(path string, filter RouteDisPatch.HttpFilter)**\\n\\n## \u53c2\u6570\u8bf4\u660e\\n\\n\\n### path\\n\\n\u7ed1\u5b9a\u7684http\u62e6\u622a\u5668\u7684\u8def\u5f84\\n\u8bf7\u6c42\u503c\u53ef\u4ee5\u4e3a:\\n1. \u6b63\u5e38\u5b57\u7b26\u4e32:\\n\\n> \u5982`/helloWorld`,\u5339\u914d\u7684\u5c31\u662f\u8bbf\u95ee`https://{basURL}/helloWorld`\u7684\u8bf7\u6c42\\n\\n\\n2. \u901a\u914d\u7b26*\u6216**\\n\\n*\u62e6\u622a\u5f53\u524d\u4e00\u7ea7\u7684\u6240\u6709\u76ee\u5f55\\n\\n**\u62e6\u622a\u5f53\u524d\u76ee\u5f55\u4e0b\u7684\u6240\u6709\u8bf7\u6c42\\n\\n> \u5982`/user/role/*/userData`\u62e6\u622a\u7684\u5c31\u662f\u8bbf\u95ee\u5982:\\n>\\n>`https://{basURL}/user/role/1/userData`\\n>\\n>`https://{basURL}/user/role/2/userData`\\n>\\n> \u7684\u6240\u6709\u8bf7\u6c42\\n\\n> \u5982`/user/role/**`\u62e6\u622a\u7684\u5c31\u662f\u8bbf\u95ee\u5982:\\n>\\n> `https://{basURL}/user/role/abc`\\n>\\n> `https://{basURL}/user/role/dc/userData`\\n> \\n> \u7684\u6240\u6709\u8bf7\u6c42\\n\\n\\n### HttpFilter\\n\\n\u62e6\u622a\u51fd\u6570\uff0c\u5bf9\u4e8e\u6bcf\u4e2ahttp\u8bf7\u6c42\u8fdb\u884c\u94fe\u5f0f\u8c03\u7528\u548c\u5904\u7406\\n\\n\u51fd\u6570\u5177\u4f53\u683c\u5f0f\u5982\u4e0b:\\n```go\\n func(w http.ResponseWriter, r *RouteDisPatch.Request, next RouteDisPatch.Next) {\\n\\n }\\n```\\n\\n\u5176\u4e2d`http.ResponseWriter`\u662fgolang\u539f\u751f`net/http``\u5305\u4e2d\u7684ResponseWriter`\\n\\n`RouteDisPatch.Request`\u662f\u5bf9golang\u539f\u751f`net/http`\u5305\u8fdb\u884c\u4e86\u4e00\u5c42\u5c01\u88c5\uff0c\u5177\u4f53\u7684\u53ef\u67e5\u770bHandler\u4e2d\u7684\u5b9a\u4e49\\n\\n`RouteDisPatch.Next`\u662f\u62e6\u622a\u5668\u7684\u94fe\u5f0f\u8c03\u7528:\\n\\n\u5728\u4e00\u4e2a\u5177\u4f53\u8def\u5f84\u4e0a\uff0c\u5982`/name/age/id`\u7684\u5b9e\u9645\u8bf7\u6c42\u4e0a\uff0c\u53ef\u80fd\u4f1a\u6709\u5982\u4e0bpath\u7684\u62e6\u622a\u5668:\\n`/name/**`,`/name/age/**`,`/name/age/id`\uff0c\u90a3\u4e48\uff0c\u8fd9\u4e00\u7cfb\u5217\u7684\u62e6\u622a\u5668\u52a0`Handler`\u51fd\u6570\u5c31\u6784\u6210\u4e86\u4e00\u5957\u5b8c\u6574\u7684\u8bf7\u6c42\u94fe\uff0c\u6392\u5217\u65b9\u5f0f\u662f:\u7236\u7ea7\u8def\u5f84\u7684\u62e6\u622a\u5668\u5728\u524d\uff0c\u5b50\u7ea7\u62e6\u622a\u5668\u7684\u8def\u5f84\u5728\u540e\uff0c\u6700\u540e\u624d\u662f\u5bf9\u5e94\u8def\u5f84\u7684`Handler`\u51fd\u6570\\n\\n\u62e6\u622a\u5668\u6267\u884c\u4e0b\u4e00\u6b65\u662f\u8c03\u7528next\u51fd\u6570\uff0c\u5c06`http.ResponseWriter`, `RouteDisPatch.Request`\u4f20\u9012\u4e0b\u53bb\u5373\u53ef\uff0c\u6846\u67b6\u5728\u6267\u884c\u5230\u672b\u7aef\u65f6\u4f1a\u81ea\u52a8\u8c03\u7528Handler\\n\\n\u793a\u4f8b:\\n\\n```go\\npackage main\\nimport(\\n\\t\\t\\"fmt\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteDisPatch\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteHand\\"\\n\\t\\"net/http\\"\\n)\\nfunc main() {\\n\\t//\u53ef\u4fe1\u7684\u8bc1\u4e66\\n\\tnewServer := server.NewServer(\\"cert.pem\\", \\"cert.key\\", \\":4445\\")\\n\\tnewServer.AddFilter(\\"/test/**\\", func(w http.ResponseWriter, r *RouteDisPatch.Request, next RouteDisPatch.Next) {\\n\\t\\tfmt.Println(\\"\u62e6\u622a\u5230\u4e86\u8bf7\u6c42\\")\\n\\t\\tnext.Next(w, r)\\n\\t\\tfmt.Println(\\"\u62e6\u622a\u8bf7\u6c42\u7ed3\u675f\\")\\n\\t})\\n}\\n```\\n\\n## CROS(\u8de8\u57df\u914d\u7f6e)\\n\\n\u8fd9\u90e8\u5206\u611f\u8c22[@tiansuo114](https://github.com/tiansuo114)\u8fdb\u884c\u5f00\u53d1\u6d4b\u8bd5\\n\\n\u4e3b\u8981\u51fd\u6570:\\n```go\\ntype CORSConfig struct {\\n\\t//\u5747\u4e3ahttp\u534f\u8bae\u4e2dAccess-Control-xxx\u7684\u54cd\u5e94\u5934\\n\\tAllowOrigins     []string//\u5141\u8bb8\u7684\u6e90\\n\\tAllowMethods     []string//\u5141\u8bb8\u7684\u8bf7\u6c42\u65b9\u6cd5\\n\\tAllowHeaders     []string//\u5141\u8bb8\u7684\u8bf7\u6c42\u5934\\n\\tAllowCredentials bool //\u5141\u8bb8\u51ed\u8bc1\\n\\tExposeHeaders    []string//\u5141\u8bb8\u524d\u7aefJS\u8bbf\u95ee\u7684\u54cd\u5e94\u5934\\n\\tMaxAge           int//\u6700\u5927\u5b58\u6d3b\u65f6\u95f4\\n}\\n\\n*Server.CROS(path string, cconf ...cors.CORSConfig) {\\n\\n}\\n```\\n\\n### \u53c2\u6570\u8bf4\u660e:\\n\\n#### path\\n\\n\u540c\u4e0a\u8ff0\u7684HttpFilter\\n\\n#### CORSConfig\\n\\n\u8de8\u57df\u914d\u7f6e\u4fe1\u606f\uff0c\u53ef\u67e5\u770b\u4e0a\u8ff0\u6ce8\u91ca\\n\\n### \u7528\u6cd5: \\n\\n\u82e5\u6ca1\u6709\u7279\u6b8a\u8981\u6c42\uff0c\u5219\u63a8\u8350\u76f4\u63a5\u4f7f\u7528\u5982\u4e0b\u65b9\u5f0f\u8fdb\u884c\u8de8\u57df\u914d\u7f6e:\\n\\n```go\\npackage main\\nimport(\\n\\t\\t\\"fmt\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteDisPatch\\"\\n\\t\\"github.com/wangshiben/QuicFrameWork/server/RouteHand\\"\\n\\t\\"net/http\\"\\n)\\nfunc main() {\\n\\t//\u53ef\u4fe1\u7684\u8bc1\u4e66\\n\\tnewServer := server.NewServer(\\"cert.pem\\", \\"cert.key\\", \\":4445\\")\\n\\tnewServer.CROS(\\"/**\\")\\n}\\n```\\n\\n> \u5f53\u65f6\u8bbe\u8ba1\u6b64\u51fd\u6570\u65f6\uff0c\u56e0\u4e3agolang\u6ca1\u6709\u591a\u6001\u8fd9\u4e2a\u6982\u5ff5\uff0c\u6240\u4ee5\u4f7f\u7528\u4e86\u53c2\u6570\u5207\u7247\u6765\u8fdb\u884c\u4f2a\u591a\u6001\uff0c\u5982\u679c\u6709\u7279\u6b8a\u9700\u6c42\u7684\u8bdd\uff0c\u53ea\u9700\u8981\u4f20\u9012\u4e00\u4e2aCROSConfig\u5373\u53ef\uff0c\u4f20\u591a\u4e2aConfig\u9ed8\u8ba4\u542f\u7528\u7b2c\u4e00\u4e2a"},{"id":"/README","metadata":{"permalink":"/blog/README","editUrl":"https://github.com/QuicFrameworkDoc/doc/tree/main/blog/blog/README.md","source":"@site/blog/README.md","title":"API\u6587\u6863","description":"\u66f4\u5feb\u7684\u4f20\u8f93\uff0c\u66f4\u8f7b\u91cf\u5316\u5f00\u53d1","date":"2024-07-26T08:54:58.000Z","tags":[],"readingTime":0.325,"hasTruncateMarker":false,"authors":[],"frontMatter":{"sidebar_position":1},"unlisted":false,"prevItem":{"title":"HttpFilter","permalink":"/blog/HttpFilter"},"nextItem":{"title":"Server","permalink":"/blog/Server"}},"content":"> \u66f4\u5feb\u7684\u4f20\u8f93\uff0c\u66f4\u8f7b\u91cf\u5316\u5f00\u53d1\\r\\n\\r\\n\u6574\u4e2a\u6846\u67b6\u5bf9\u5916\u63d0\u4f9b\u51fd\u6570\u53ea\u6709\u5982\u4e0b\u90e8\u5206:\\r\\n\\r\\n1. \u5904\u7406\u5668(Handler)\\r\\n\\r\\n\u7528\u4e8e\u5904\u7406http\u8bf7\u6c42\\r\\n\\r\\n\\r\\n2. \u62e6\u622a\u5668/\u4e2d\u95f4\u4ef6(Filter)\\r\\n\\r\\n\u7528\u4e8e\u5728http\u8bf7\u6c42\u4e4b\u524d\u5bf9\u8bf7\u6c42\u8fdb\u884c\u62e6\u622a\u5904\u7406"},{"id":"/Server","metadata":{"permalink":"/blog/Server","editUrl":"https://github.com/QuicFrameworkDoc/doc/tree/main/blog/blog/Server.md","source":"@site/blog/Server.md","title":"Server","description":"Server\u5305\u4f5c\u4e3a\u6574\u4e2a\u670d\u52a1\u7684\u63d0\u4f9b\u8005\u548c\u542f\u52a8\u5165\u53e3\uff0c\u8fd9\u91cc\u7684Server\u6307\u7684\u662f\u7a0b\u5e8f\u542f\u52a8\u548c\u521d\u59cb\u5316\u76f8\u5173\u7684\u51fd\u6570API","date":"2024-07-26T08:54:58.000Z","tags":[],"readingTime":1.395,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false,"prevItem":{"title":"API\u6587\u6863","permalink":"/blog/README"}},"content":"> Server\u5305\u4f5c\u4e3a\u6574\u4e2a\u670d\u52a1\u7684\u63d0\u4f9b\u8005\u548c\u542f\u52a8\u5165\u53e3\uff0c\u8fd9\u91cc\u7684Server\u6307\u7684\u662f\u7a0b\u5e8f\u542f\u52a8\u548c\u521d\u59cb\u5316\u76f8\u5173\u7684\u51fd\u6570API\\r\\n\\r\\n\\r\\n\u76ee\u524dServer\u63d0\u4f9b\u4e86\u4e24\u4e2a\u542f\u52a8\u65b9\u5f0f:\\r\\n\\r\\n1. \u57fa\u4e8eTLS\u8bc1\u4e66\u542f\u52a8\uff0chttps\u8bbf\u95ee\\r\\n2. Http\u542f\u52a8(\u8fd8\u5728\u6d4b\u8bd5\u4e2d\uff0c\u5c5e\u4e8efeature\u529f\u80fd)\\r\\n\\r\\n## TLS\u542f\u52a8:\\r\\n\\r\\n\u76f8\u5173\u51fd\u6570:\\r\\n\\r\\n\u521d\u59cb\u5316Server:**server.NewServer(TLSPem, TLSKey, port string)**\\r\\n\\r\\n\u542f\u52a8Server:**\\\\*Server.StartServer()**\\r\\n\\r\\n### \u53c2\u6570\u8bf4\u660e:\\r\\n\\r\\n#### TSLPem\u548cTLSKey\\r\\n\\r\\nTSL\u8bc1\u4e66\u7684pem\u548ckey\u6587\u4ef6\u8def\u5f84\uff0c\u53ef\u4ee5\u662f\u76f8\u5bf9\u8def\u5f84\u4e5f\u53ef\u4ee5\u662f\u7edd\u5bf9\u8def\u5f84\uff0c\u5982\u679c\u6ca1\u6709\u503c\u5219\u4f20\\"\\"\u5373\u53ef(\u7a7a\u503c\u4e3a\u9ed8\u8ba4\u81ea\u52a8\u751f\u6210\u8bc1\u4e66\uff0c\u751f\u6210\u81ea\u7b7e\u540d\u8bc1\u4e66)\\r\\n\\r\\n> **\u6ce8\u610f** TSLPem\u548cTLSKey\u5fc5\u987b\u540c\u65f6\u4f20\uff0c\u4e0d\u80fd\u53ea\u4f20\u4e00\u4e2a\uff0c\u5426\u5219\u4f1a\u542f\u52a8\u5931\u8d25\\r\\n\\r\\n#### port\\r\\n\\r\\n\u76d1\u542c\u7684\u7aef\u53e3\u53f7\uff0c\u683c\u5f0f\u4e3a: `:number`\uff0c\u4f1a\u5360\u7528\u76ee\u6807\u7aef\u53e3\u7684TCP\u548cUDP\u7aef\u53e3\uff0c\u8bf7\u63d0\u524d\u5f00\u542f\u76ee\u6807\u7aef\u53e3\u7684\u9632\u706b\u5899\uff0c\u4ee5\u514d\u63a5\u6536\u4e0d\u5230\u5305\\r\\n\\r\\n\\r\\n## Http\u542f\u52a8\\r\\n\\r\\n\u521d\u59cb\u5316Server:**server.NewHttpServer(port string)**\\r\\n\\r\\n\u542f\u52a8HttpServer:**\\\\*Server.StartHttpSerer()**\\r\\n\\r\\n### \u53c2\u6570\u8bf4\u660e:\\r\\n\\r\\n#### port\\r\\n\\r\\n\u76d1\u542c\u7684\u7aef\u53e3\u53f7\uff0c\u683c\u5f0f\u4e3a: `:number`\uff0c\u4f1a\u5360\u7528\u76ee\u6807\u7aef\u53e3\u7684TCP\u7aef\u53e3\uff0c\u8bf7\u63d0\u524d\u5f00\u542f\u76ee\u6807\u7aef\u53e3\u7684\u9632\u706b\u5899\uff0c\u4ee5\u514d\u63a5\u6536\u4e0d\u5230\u5305"}]}}')}}]);